import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for product cards to load
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Get all product cards
    const productCards = await page.$$('.product-card');
    if (productCards.length < 3) {
      throw new Error('Not enough products found for stress test');
    }

    // Add first 3 products to cart rapidly
    for (let i = 0; i < 3; i++) {
      const addToCartBtn = await productCards[i].$('.add-to-cart');
      await addToCartBtn.click();

      // Wait briefly between clicks to simulate rapid interaction
      await page.waitForTimeout(200);
    }

    // Take screenshot after adding products
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_adding.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_adding.png'));

    // Open cart modal
    await page.click('.cart');
    await page.waitForSelector('#cartModal', { state: 'visible', timeout: 5000 });

    // Take screenshot of cart with items
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_open.png'));

    // Get cart items and perform rapid manipulations
    const cartItems = await page.$$('.cart-item');

    // Increase quantity of first item
    const firstItemPlus = await cartItems[0].$('.quantity-btn:last-of-type');
    await firstItemPlus.click();

    // Remove second item
    const secondItemRemove = await cartItems[1].$('.remove-item');
    await secondItemRemove.click();

    // Wait for cart to update
    await page.waitForTimeout(500);

    // Take final screenshot after manipulations
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_after_manipulations.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_after_manipulations.png'));

    // Extract cart count for verification
    const cartCount = await page.$eval('.cart', el => {
      const text = el.textContent;
      return parseInt(text.match(/\d+/)[0]);
    });

    return {
      success: true,
      action: "Performed rapid cart manipulation stress test with 3 products",
      extractedData: {
        finalCartCount: cartCount,
        operationsPerformed: ["Added 3 products", "Increased quantity of first item", "Removed second item"]
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete rapid cart manipulation stress test",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
